import React, { Component } from "react";
import Stock from "../Component/Stock";
import Donor from "../Component/Donor";
import Search from "../Component/Search";
import {
    Route,
    NavLink,
    HashRouter
  } from "react-router-dom";

class StockHome extends Component{
    
    
        
    render() {
        return (
            <HashRouter>
            <div className="header">
                <li><NavLink exact to="/">Donor</NavLink></li>
                <li><NavLink to ="/search">Search Donor</NavLink></li>
                <Route exact path="/" component={Donor}/>
            <Route path="/search" component={Search}/>
                {/* <button className="btn btn-primary">Show Blood Stock</button>
                <button className="btn btn-primary" >Update Stock</button> */}
                
                </div>
                </HashRouter>
        );
    }
}
export default StockHome
